COPY public.news_and_updates (id, type, priority, title, "shortDescription", content, "isActive", "createdAt", "updatedAt", "createdBy", "updatedBy", "imageUrl", "externalLink") FROM stdin;
fa182fa1-539f-4a6c-9d0e-b795d9c33d7d	marketUpdate	high	Bitcoin Halving Completed – Market Reaction	The fourth Bitcoin halving has concluded, reducing block rewards to 3.125 BTC. Analysts weigh in on potential price impacts.	<p class="my-2">The highly anticipated Bitcoin halving event has officially taken place, cutting miner rewards from 6.25 BTC to 3.125 BTC per block. Historically, halvings have preceded major bull runs, but the immediate market reaction has been mixed, with BTC consolidating near $64,000.</p><p class="my-2">Key factors to watch:</p><ul><li><p class="my-2"><strong>Miner profitability:</strong> Hashrate adjustments may lead to short-term volatility as less efficient miners exit.</p></li><li><p class="my-2"><strong>ETF inflows:</strong> Continued demand from spot Bitcoin ETFs could offset selling pressure.</p></li><li><p class="my-2"><strong>Macro conditions:</strong> Fed rate decisions and geopolitical risks remain influential.</p></li></ul><p class="my-2">Experts suggest a potential "slow burn" rally rather than an instant surge, with the full impact unfolding over 12–18 months. Traders should monitor on-chain metrics like exchange reserves and miner outflows for early trend signals.</p>	t	2025-04-08 15:44:14.249237	2025-04-08 15:45:08.738118	\N	\N	https://img.freepik.com/free-photo/copy-space-bitcoin-different-colors_23-2148285316.jpg?t=st=1744123493~exp=1744127093~hmac=6a2b1c07b76685bf0fcfa920528a6381eff4a680baff188f6cc96bf3e6f679ac&w=1380	https://coinbase.com
09c0d974-848b-4ccc-9234-00d2812c7118	announcement	medium	Solana (SOL) Staking Now Live – Earn Up to 6.5% APY	Stake SOL directly in our app with competitive rewards and flexible unstaking options.\nType: Announcement	<p class="my-2">We’re thrilled to announce that Solana (SOL) staking is now available on our platform! Users can earn passive income by delegating their SOL to trusted validators without locking funds indefinitely.</p><p class="my-2"><strong>Key Features:</strong></p><ul><li><p class="my-2"><strong>Estimated APY:</strong> 5.5%–6.5% (variable based on network conditions).</p></li><li><p class="my-2"><strong>Flexible unstaking:</strong> Requests process within 2–3 days (no fixed lock-up periods).</p></li><li><p class="my-2"><strong>Auto-compounding:</strong> Rewards are distributed daily and can be restaked automatically.</p></li></ul><p class="my-2"><strong>Why Stake SOL?</strong><br>Solana’s high-speed, low-fee ecosystem continues to grow, with increasing adoption in DeFi and NFTs. Staking helps secure the network while putting your idle assets to work.</p><p class="my-2"><em>Note: Slashing risks are minimal on Solana, but rewards may fluctuate with validator performance.</em></p>	t	2025-04-08 15:47:25.408915	2025-04-08 15:47:25.408915	\N	\N	https://i0.wp.com/coinsutra.com/wp-content/uploads/2022/04/Stake-SOL-Token.webp	https://coinsutra.com/solana-staking/
b78a256f-4e7d-41d4-8dfb-7104cf74bab4	alert	low	Critical Security Alert: Surge in Fake Support Scam	Fraudsters are impersonating our team via fake apps, emails, and social media.	<p class="my-2">We’ve observed a sharp rise in sophisticated phishing attacks targeting our users, including:</p><ul><li><p class="my-2"><strong>Fake mobile apps</strong> on third-party stores mimicking our interface.</p></li><li><p class="my-2"><strong>"Support" agents</strong> on Telegram/X asking for recovery phrases or 2FA codes.</p></li><li><p class="my-2"><strong>Spoofed emails</strong> claiming "suspicious activity" with malicious links.</p></li></ul><p class="my-2"><strong>How to Stay Safe:</strong><br>✅ Always download our app <strong>only</strong> from official stores (Google Play/App Store).<br>✅ Never share passwords, 2FA codes, or private keys—our team will <strong>never</strong> ask for these.<br>✅ Bookmark our official website and enable <strong>whitelisting</strong> for withdrawals.</p><p class="my-2">Report suspicious activity to security@nadiapoint.com</p>	t	2025-04-08 15:49:51.357105	2025-04-14 00:05:57.715402	\N	\N	https://img.freepik.com/free-photo/html-css-collage-concept-with-hacker_23-2150061984.jpg?t=st=1744123690~exp=1744127290~hmac=4717f8bbfa2b35c4870f7bb79a5aaa3fcf2118a7f393b0a4aa5076b19af5b4e8&w=1380	https://nordvpn.com/blog/google-critical-security-alert/
